import axios from "axios";
export default {
  name: "prestataireUpdateManege",
  props: {
    id: Number
  },
  data: () => {
    return {
      id_user: null,
      manege: null
    };
  },
  mounted() {
    this.id_user = this.$store.state.user.id;
    axios({
      method: 'get',
      url: 'http://localhost:3000/prestataires/' + this.id_user + '/manege/' + this.id
    }).then(result => {
      console.log(result);
    }).catch(error => {
      console.log(error);
    });
  }
};
